import React from "react";
import "./dynamicFilters.css";

const DynamicFilters: React.FC = ()=>{
    return(
        <div id="filters-buttons-container">
            <button>Price Range <img src="./Assets/dynamic-filter-btn-drop-symbol.svg" alt="" /></button>
            <button>Distance <img src="./Assets/dynamic-filter-btn-drop-symbol.svg" alt="" /></button>
            <button>Rating <img src="./Assets/dynamic-filter-btn-drop-symbol.svg" alt="" /></button>
        </div>
    );
}

export default DynamicFilters;
